import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';

const CompReservaForm = () => {
  const { id_libro } = useParams();
  const navigate = useNavigate();
  const [libro, setLibro] = useState(null);
  const [formData, setFormData] = useState({
    nombres: '',
    ap_paterno: '',
    ap_materno: '',
    fecha_reserva: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchLibro = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/libros/${id_libro}`);
        setLibro(response.data);
      } catch (err) {
        setError('Error al cargar la información del libro');
      } finally {
        setLoading(false);
      }
    };

    fetchLibro();
  }, [id_libro]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');

    try {
      const token = localStorage.getItem('token');
      const response = await axios.post('http://localhost:8000/reservas', {
        id_libro,
        ...formData
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });

      if (response.data.success) {
        navigate('/mis-reservas', { state: { message: 'Reserva realizada con éxito' } });
      }
    } catch (err) {
      setError(err.response?.data?.message || 'Error al realizar la reserva');
    }
  };

  if (loading) return <div className="container mt-5">Cargando...</div>;
  if (error) return <div className="container mt-5 alert alert-danger">{error}</div>;

  return (
    <div className="container mt-5">
      <h2 className="mb-4">Reservar Libro</h2>
      {libro && (
        <div className="card mb-4">
          <div className="card-body">
            <h5 className="card-title">{libro.titulo}</h5>
            <p className="card-text">Autor: {libro.autor}</p>
          </div>
        </div>
      )}
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="nombres" className="form-label">Nombres</label>
          <input
            type="text"
            className="form-control"
            id="nombres"
            name="nombres"
            value={formData.nombres}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="ap_paterno" className="form-label">Apellido Paterno</label>
          <input
            type="text"
            className="form-control"
            id="ap_paterno"
            name="ap_paterno"
            value={formData.ap_paterno}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="ap_materno" className="form-label">Apellido Materno</label>
          <input
            type="text"
            className="form-control"
            id="ap_materno"
            name="ap_materno"
            value={formData.ap_materno}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="fecha_reserva" className="form-label">Fecha de Reserva</label>
          <input
            type="date"
            className="form-control"
            id="fecha_reserva"
            name="fecha_reserva"
            value={formData.fecha_reserva}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit" className="btn btn-primary">Realizar Reserva</button>
      </form>
    </div>
  );
};

export default CompReservaForm;
